import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [name, setName] = useState('');
  const [dob, setDob] = useState('');
  const [reports, setReports] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [generatedReport, setGeneratedReport] = useState(null);

  // Function to handle report generation
  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!name || !dob) return alert("Please enter both fields");

    try {
      const res = await axios.post('http://localhost:5000/api/createreport', { name, dob });
      setGeneratedReport(res.data);
      setIsModalOpen(true); // Open the modal to show the report
      fetchReports();
    } catch (error) {
      alert('Error generating report');
    }
  };

  // Function to fetch past reports
  const fetchReports = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/fetchreports/1'); // Adjust user ID accordingly
      setReports(res.data.reports);
    } catch (error) {
      alert('Error fetching reports');
    }
  };

  useEffect(() => {
    fetchReports();
  }, []);

  // Close the modal
  const closeModal = () => {
    setIsModalOpen(false);
  };

  return (
    <div style={{ padding: '2rem', fontFamily: 'sans-serif' }}>
      <h1>Numerology Prediction</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
        <input
          type="date"
          value={dob}
          onChange={(e) => setDob(e.target.value)}
          required
        />
        <button type="submit">Get Report</button>
      </form>

      <button onClick={() => window.location.href = '/reports'}>Go to Reports</button>

      {/* Modal Popup */}
      {isModalOpen && (
        <div style={modalStyles}>
          <div style={modalContentStyles}>
            <h2>Numerology Report for {generatedReport?.name}</h2>
            <p><strong>Life Path Number:</strong> {generatedReport?.lifePathNumber}</p>
            <p><strong>Expression Number:</strong> {generatedReport?.expressionNumber}</p>
            <p><strong>Soul Urge Number:</strong> {generatedReport?.soulUrgeNumber}</p>
            <p><strong>Personality Number:</strong> {generatedReport?.personalityNumber}</p>
            <button onClick={closeModal}>Close</button>
          </div>
        </div>
      )}

      <h2>Past Reports</h2>
      <table border="1" cellPadding="10">
        <thead>
          <tr><th>Name</th><th>DOB</th><th>Life Path</th><th>Expression</th><th>Soul Urge</th><th>Personality</th></tr>
        </thead>
        <tbody>
          {reports.map((r, i) => (
            <tr key={i}>
              <td>{r.name}</td>
              <td>{r.dob}</td>
              <td>{r.lifePathNumber}</td>
              <td>{r.expressionNumber}</td>
              <td>{r.soulUrgeNumber}</td>
              <td>{r.personalityNumber}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

// Modal styles
const modalStyles = {
  position: 'fixed',
  top: '0',
  left: '0',
  width: '100%',
  height: '100%',
  backgroundColor: 'rgba(0, 0, 0, 0.5)',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
};

const modalContentStyles = {
  backgroundColor: 'white',
  padding: '20px',
  borderRadius: '5px',
  textAlign: 'center',
  minWidth: '300px',
};

export default App;
